void sortN(double *X, double *I , int N );

#define FULL_SORT_N  40


void preSort( double *X , double *I , int N , int *fNoNEG , int *lNoPOS ){
  double  temp;
  int lNoNAN[1], k;
  
  #define isPOS( x )    ( mxIsInf(x)  &&  (x) > 0  )
  #define isNEG( x )    ( mxIsInf(x)  &&  (x) < 0  )
  #define isNAN( x )    ( !( x == x ) )
  (*fNoNEG) = 0;
  while( isNEG( X[ (*fNoNEG) ] ) ){ (*fNoNEG)++; }
  
  (*lNoNAN) = N-1;
  while( isNAN( X[ (*lNoNAN) ] ) ){ (*lNoNAN)--; }
  
  (*lNoPOS) = (*lNoNAN);
  while( isPOS( X[ (*lNoPOS) ] ) ){ (*lNoPOS)--; }
  
  k = (*fNoNEG);
  while( k <= (*lNoPOS) ){
    if( k < (*fNoNEG) ){ k++; continue; }
    
    if( isNEG( X[k] ) ){
      swap( k , (*fNoNEG) ); (*fNoNEG)++; while( isNEG( X[ (*fNoNEG) ] ) ){ (*fNoNEG)++; }
    } else if( isPOS( X[k] ) ){
      swap( k , (*lNoPOS) ); (*lNoPOS)--; while( isPOS( X[ (*lNoPOS) ] ) ){ (*lNoPOS)--; }
    } else if( isNAN( X[k] ) ){
      swap( k , (*lNoNAN) ); (*lNoNAN)--; while( isNAN( X[ (*lNoNAN) ] ) ){ (*lNoNAN)--; }
      if( (*lNoPOS) > (*lNoNAN) ){ (*lNoPOS) = (*lNoNAN); }
    } else {
      k++;
    }

  }
  
}



void SELECT( double *X, double *I, int left , int right , int k ){
  
  double temp;
  int    pivotIndex, pivotNewIndex, distance;
  
  while( 1 ){
    
    distance = right - left + 1;
    if( distance <  FULL_SORT_N ) {      
      sortN( X+left , I+left , distance );
      return;
    }
    
    pivotIndex = (int) ( ( left + right )/2 );
    pivotNewIndex = PARTITION( X , I , left , right , pivotIndex );
    
    if( pivotNewIndex == k ){
      break;
    } else if( k < pivotNewIndex ){
      right = pivotNewIndex - 1;
    } else {
      left = pivotNewIndex + 1;
    }
      
  }

}


