void PartialSort( double *X, double *I, int left , int right , int K0 , int K1 ){

  double  temp;
  int     pivotIndex, pivotNewIndex, distance, k;
  char    isSorted;
  
  distance = right - left + 1;
  if( distance <  FULL_SORT_N ) {
    sortN( X+left , I+left , distance );
    return;
  }

  isSorted = 1;
  for( k = left ; k < right  &&  isSorted; k++ ){
    if( X[k] > X[k+1] ){ isSorted = 0; }
  }; if( isSorted ){ return; }

  
  pivotIndex = (int) ( ( left + right )/2 );
  pivotNewIndex = PARTITION( X , I , left , right , pivotIndex );

    distance = pivotNewIndex - left;
    if( distance < FULL_SORT_N ){
      sortN( X+left , I+left , distance );
    } else {
      if( pivotNewIndex < K0 ){
        PartialSort( X , I , K0+1 , pivotNewIndex-1 , K0 , K1 );
      } else {
        PartialSort( X , I , left , pivotNewIndex-1 , K0 , K1 );
      }
    }

    
  if( pivotNewIndex < K1 ){

    distance = right - pivotNewIndex ;
    if( distance < FULL_SORT_N ){
      sortN( X+pivotNewIndex+1 , I+pivotNewIndex+1 , distance );
    } else {
      PartialSort( X , I , pivotNewIndex+1 , right , K0 , K1 );
    }

  }

}





void FullSort( double *X, double *I, int left , int right ){

  double  temp;
  int     pivotIndex, pivotNewIndex, distance, k;
  char    isSorted;

  
  distance = right - left + 1;
  if( distance <  40 ) {
    sortN( X+left , I+left , distance );
    return;
  }
  
  isSorted = 1;
  for( k = left ; k < right && isSorted; k++ ){
    if( X[k] > X[k+1] ){ isSorted = 0; }
  }; if( isSorted ){ return; }
  

  pivotIndex = (int) ( ( left + right )/2 );
  pivotNewIndex = PARTITION( X , I , left , right , pivotIndex );

  
    distance = pivotNewIndex - left;
    if( distance < 40 ){
      sortN( X+left , I+left , distance );
    } else {
      FullSort( X , I , left , pivotNewIndex-1 );
    }

    
    distance = right - pivotNewIndex;
    if( distance < 40 ){
      sortN( X+pivotNewIndex+1 , I+pivotNewIndex+1 , distance );
    } else {
      FullSort( X , I , pivotNewIndex+1 , right );
    }

    
}




void mexFunction( int nlhs, mxArray *plhs[], int nrhs, const mxArray *prhs[]){

  int      N, k, Kp1, lNoNAN, lNoPOS, fNoNEG, i;
  double   *X, *I, temp;
  int      K, K0, K1, lastK;
  
  
  if( mxIsCell( prhs[0] ) ){

    if( mxGetNumberOfElements( prhs[0] ) != 2 ){
      mxErrMsgTxt("two vectors expected in the cell");
    }

    if( mxGetNumberOfElements( mxGetCell( prhs[0] , 0 ) ) !=  mxGetNumberOfElements( mxGetCell( prhs[0] , 1 ) ) ){
      mxErrMsgTxt("two vectors of the same size are expected in the cell");
    }    
    
    plhs[0] = mxDuplicateArray(  mxGetCell( prhs[0] , 0 ) );
    N = mxGetNumberOfElements( plhs[0] );
    X = mxGetPr( plhs[0] );

    plhs[1] = mxDuplicateArray(  mxGetCell( prhs[0] , 1 ) );
    I = mxGetPr( plhs[1] );
    
    
  } else {
  
    plhs[0] = mxDuplicateArray(   prhs[0] );
    N = mxGetNumberOfElements( plhs[0] );
    X = mxGetPr( plhs[0] );


    plhs[1] = myDuplicateArray_E( prhs[0] );
    I = mxGetPr( plhs[1] );
    for( k = 0 ; k < N ; k++ ){
      I[k] = k+1;
    }
    
  }
  

if(1){  

  preSort( X , I , N , &fNoNEG , &lNoPOS );

} else {

  fNoNEG = 0;
  lNoPOS = N-1;
  
}

  if( nrhs < 2 ){
    
    FullSort( X , I , fNoNEG  , lNoPOS );
    
  } else if( mxIsCell( prhs[1] ) ) {
    
    lastK = fNoNEG - 1 ;
    for( k = 0 ; k < mxGetNumberOfElements( prhs[1] ) ; k++ ){
      
      if( mxGetNumberOfElements( mxGetCell( prhs[1] , k ) ) != 1 ){
        mxErrMsgTxt("bad syntax!!");
      }
      
      K = myGetValue( mxGetCell( prhs[1] , k ) ) - 1;
      
      
      if(    K < 0       ){ mxErrMsgTxt("zeros or negative index"); }
      if(    K < fNoNEG  ){ continue;                               }
      if(    K > N-1     ){ mxErrMsgTxt("index too large");         }
      if( !( K > lastK ) ){ mxErrMsgTxt("non increasing indexs"  ); }
      
      if( K <= lNoPOS ){
      //mexPrintf("\nponer en su lugar a K: %d\n", K+1 );
        SELECT( X, I, lastK + 1 , lNoPOS , K );
      }
      
      lastK = K;
      
    }

  } else {
    
    if( mxGetNumberOfElements( prhs[1] ) == 1 ){
      K0 = 0;
      K1 = myGetValue( prhs[1] );
    } else if( mxGetNumberOfElements( prhs[1] ) == 2 ){
      K0 = myGetValueIth( prhs[1] , 0 )-1;
      K1 = myGetValueIth( prhs[1] , 1 );
      
      if( K0 > K1 ){
        mxErrMsgTxt("Invalid Syntax  K0 > K1");
      }
      
    } else {
      mxErrMsgTxt("Invalid Syntax 2 elements expected");
    }
    
    if( K1 > N ){ mxErrMsgTxt("K is greater than N"); }

    if( K1 > fNoNEG  &&  K0 < lNoPOS ){
  
      PartialSort( X , I , fNoNEG , lNoPOS , K0 , K1 );
      
      if( K1 < lNoPOS && X[K1-1] == X[K1] ){
        Kp1 = K1+1;
        while( Kp1 < lNoPOS && X[Kp1] == X[K1] ){ Kp1++; }
        
        for( k = Kp1 ; k < lNoPOS ; k++ ){
          if( X[k] == X[K1] ){
            swap( Kp1 , k ); Kp1++;
          }
        }
      }

      if( K0 > fNoNEG ){
        Kp1 = K0-1;
        while( Kp1 > fNoNEG && X[Kp1] == X[K0] ){ Kp1--; }
        
        for( k = Kp1 ; k > fNoNEG ; k-- ){
          if( X[k] == X[K0] ){
            swap( Kp1 , k ); Kp1--;
          }
        }
      }
      
      
    }
    
  }
  
}






void sortN( double *X , double *I , int N ){
  register int j, i;
  double       tempI, temp;
  

  if( N <= 1 ) {                 return; }
  if( N == 2 ) { sort2( X , I ); return; }
  if( N == 3 ) { sort3( X , I ); return; }
  if( N == 4 ) { sort4( X , I ); return; }
  if( N == 5 ) { sort5( X , I ); return; }
/*  if( N == 6 ) { sort6( X , I ); return; } */
/*  if( N == 7 ) { sort7( X , I ); return; } */
  
  
  for( j = 1 ; j < N ; j++ ) {
    temp  = X[j];
    tempI = I[j];
    for( i = j - 1 ; ( i >= 0 ) && ( temp < X[i] ) ; i-- ){
      I[i + 1] = I[i];
      X[i + 1] = X[i];
    }
    X[i + 1] = temp;
    I[i + 1] = tempI;
  }
}
void sort2(double* a, double* o){
double  temp;
if (a[0]>a[1]){
temp=a[0]; a[0]=a[1]; a[1]=temp;
temp=o[0]; o[0]=o[1]; o[1]=temp;
}
}

